import React, { useContext } from 'react'
import "./Topbar.css"
import AddIcon from '@mui/icons-material/Add';
import { NavLink } from 'react-router-dom';
import AccountCircleIcon from '@mui/icons-material/AccountCircle';
import { AuthContext } from '../../context/AuthContext';
import { removeTokenFromLocalStorage } from '../../lib/common';
function Topbar() {
    const { dispatch } = useContext(AuthContext)
    const logout = (e) => {
        console.log("logout")
        e.preventDefault()
        dispatch({ type: "LOGOUT" })
        removeTokenFromLocalStorage()


    }
    return (
        <div class="navbar">
            <div class="brand">
                <NavLink to="/" ><a className="navbar-brand">UNH Social</a></NavLink>
            </div>
            <div className='right'>
                <NavLink to="/create/post"><AddIcon style={{ color: "#ffffff", fontSize: 30 }} /></NavLink>
                <NavLink to="/profile/sunny"><AccountCircleIcon style={{ fontSize: 40 }} /></NavLink>
                <button className='btn btn-primary' onClick={() => logout}>Logout</button>
            </div>
        </div>
    )
}

export default Topbar
